import { Link } from "react-router-dom";

const Footer = () => {
  return (
    <footer className="text-center p-[4rem] bg-khamco-ribbon text-white">
      <h4 className="text-[2rem] my-[1rem] mx-0">&copy; Khamco</h4>
      <address>Kuwait</address>
      <nav>
        <ul>
          <li>
            <Link to="/" className="text-white">Main Menu</Link>
          </li>
          <li>
            <Link to="/customers" className="text-white">Customers</Link>
          </li>
          <li>
            <Link to="/admin/dashboard" className="text-white">Administration</Link>
          </li>
          <li>
            <Link to="/" className="text-white">Shop Select</Link>
          </li>
        </ul>
      </nav>
    </footer>
  );
};

export default Footer;
